        {/* {loginStatus?
          <button className='btn btn-sm btn-danger' onClick={() => logoutHandler()}>Logout</button>:
          <button className='btn btn-sm btn-primary' onClick={() => loginHandler()}>Login</button>
        } */}
      </div>
  );
}

export default App;
